import React, { useState} from 'react';

const person = (Props) => {

    const [expertState, setExpertState] = useState({
        techExperts: [
          {name: 'Max', experiance: '3yrs'},
          {name: 'Lina', experiance: '7yrs'},
          {name: 'Joe', experiance: '5yrs'}
        ]
      });

    return (
        <div>
            <h2>Hey this is parent component</h2>
            <p>this parent is great. My name is <span style={{color: "red"}}>{Props.name}</span> and I am <span style={{color: "red"}}>{ Math.floor(Math.random() * 30) }</span> yrs old</p>
            <p>I think <span style={{color: "#555555"}}>{Props.children}</span></p>
        </div>
    );
}

export default person;
